try {
    String unescapedURL = URLDecoder.decode(url, StandardCharsets.UTF_8.name());
    unescapedURL = StringEscapeUtils.unescapeXml(unescapedURL);
    String encodedUrl = unescapedURL.replace("\"", "%22")
            .replace("'", "%27")
            .replace(">", "%3E")
            .replace("<", "%3C")
            .replace("`", "%60")
            .replace(" ", "%20");
    // Fix for CONF-35596:
    // The regex expression used to replace ':' characters in the url. It is not a good idea to replace
    // ':' character of the email address in the url.
    int qMarkIx = encodedUrl.indexOf('?');
    if (qMarkIx > 0) {
        encodedUrl = encodedUrl.substring(0, qMarkIx) + encodedUrl.substring(qMarkIx).replaceAll("(?<!mailto:|tel:|sms:|skype:|facetime:)(?:\\:)", "%3A");
    }
    encodedUrl = mangleNamespaces(encodedUrl);
    if (xssFilter.isValidHref(encodedUrl)) {
        return encodedUrl;
    }
} catch (UnsupportedEncodingException e) {
    LOGGER.error("Unable to decode url: {}.", url);
}

